import React from "react";
import "../PSOne/PSone.css";

const Footer = () => {
  return (
    <div class="container light">
      <label class="title">Footer</label>
      <p>Skipper Lizbeth Thurman - March 2023</p>
    </div>
  );
};

export default Footer;
